/**
 * setClientLogTypes 单独一个文件与 invoke 等函数进行分割。
 * 避免打包完成后 d.ts 文件直接 import 完整文件，无法分割 ts 代码，造成 invoke 等类型依然存在于打包后的代码中，造成非必要依赖依然存在
 * 正常情况下，d.ts 产物是不会进行 bundle(将多个文件打包成一个) 处理的。
 */
export declare type SetClientLogTypes = 'setCurrentPage' | 'addElementShowEvent' | 'addTaskEvent' | 'addCustomEvent' | 'addCustomStatEvent' | 'closeCoPage';
